import React from "react";

import "./Job.module.css";

const Job = () => {
  return (
    <div>
      <h3>May 2023 - August 2023</h3>
      <h1>Software Engineer Intern</h1>
      <h2>Salesforce &#x2022; San Francisco, CA</h2>
    </div>
  );
};

export default Job;
